      SELECT ALL + col2 AS col2, col1 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col1 NOT BETWEEN - col0 + + - ( + + col2 ) + - col0 AND 45;
  - name: tab2

outputs:
  - name: q3853.out
    data: |
